import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { Observable, of, BehaviorSubject } from 'rxjs';
import { map, filter, switchMap, catchError } from 'rxjs/operators';
import { Router } from '@angular/router';
import { environment } from '@environments/environment';

@Injectable({
  providedIn: 'root',
})
export class EmployeeService {
  private server = environment.host;
  constructor(private http: HttpClient) {}

  getEmployeeData(employee: any): Observable<any> {
    return this.http.get<any>(`${this.server}/employee?id=${employee.id}&page=${employee.type}`).pipe(
      map((res) => <any[]>res.data),
      catchError(this.handleError)
    );
  }

  getEmployeeStats(data: any): Observable<any> {
    /* ?range_start=${data.range_start}&range_end=${data.range_end}&employee_id=${data.id}&content=employee */
    return this.http.get<any>(`${this.server}/summary-report?range_start=${data.range_start}&range_end=${data.range_end}&employee_id=${data.id}&content=employee`).pipe(
      map((res) => <any[]>res.data),
      catchError(this.handleError)
    );
  }

  saveEmployee(data:any): Observable<any> {
    return this.http.post<any>(`${this.server}/employee`, data).pipe(
      map((res: any) => <any[]>res),
      catchError(this.handleError)
    );
  }

  editEmployee(employee: any): Observable<any> {
    return this.http.put(`${this.server}/employee`, employee)
    .pipe(
      map((res) => <any>res)
    );
  }

  editEmployeeQualification(data: any): Observable<any> {
    let body;
    let requestData;
    let endpoint = data?.update_type === 'training' ? 'employee-training' : 'employee-qualification';

    if(data?.id){
      body = {
        id: data?.id,
        employee_id: data?.employee_id,
        notes: data?.notes,
        status: data?.status,
        expiry_date: data?.expiry_date,
        completion_date: data?.completion_date,
        attachment: [data?.attachment],
        /*"attachment": [
            {
                "filename": "COVID-19 INFECTION CONTROL CERT.jpg",
                "size": 58842,
                "type": "image/jpeg",
                "file": "data:image/jpeg;base64,"
            }
        ]*/
      }

      console.log(body, data, "SAVE BODY")

      requestData = this.http.put(`${this.server}/${endpoint}`, body)
    }

    else {
      body = {
        employee_id: data?.employee_id,
        notes: data?.notes,
        qualification_id: data?.qualification_id,
        status: data?.status,
        expiry_date: data?.expiry_date,
        completion_date: data?.completion_date,
        attachment: [data?.attachment],
        /* "attachment": [
            {
                "filename": "COVID-19 INFECTION CONTROL CERT.jpg",
                "size": 58842,
                "type": "image/jpeg",
                "file": "data:image/jpeg;base64,"
            }
        ]*/
      }

      requestData = this.http.post(`${this.server}/${endpoint}`, body)
    }


    //form_data: this.certificateForm.value,

    return requestData.pipe(
      map((res) => <any>res)
    );
  }


  // error handler
  private handleError(error: any, caught: any): any {
    throw error;
  }
}
